hterm_pref_character_map_overrides.message:
Tinutukoy ito bilang object. Isa itong sparse array, kung saan ang bawat property ay ang character set code at ang value ay isang object na isang sparse array mismo. Sa sparse array na iyon, ang bawat property ay ang natanggap na character at ang value ay ang ipinapakitang character.

Halimbawa:
{ "0": {
  "+": "\u2192",
  ",": "\u2190",
  "-": "\u2191",
  ".": "\u2193",
  "0": "\u2588"
} }
